import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import {Navbar,Nav,Container}from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BasePage } from './Componets/BasePage';
import { BuyItem } from './Componets/BuyItem';
import { Checkout } from './Componets/CheckOut';
import { Admin } from './Componets/Admin';
class App extends Component {
  render() {
  return (

    <Router>
    <div className="App">
    <Navbar bg="primary" variant="dark">
    <Container>
    <Navbar.Brand href="#home">
    <img src="" class="img-fluid"></img>
    </Navbar.Brand>
    <Nav className="me-auto">
      <Nav.Link href="/">Home</Nav.Link>
      <Nav.Link href="/BuyItem">Order</Nav.Link>
      <Nav.Link href="/Checkout">Checkout</Nav.Link>
      <Nav.Link href="/Admin">Admin</Nav.Link>
    </Nav>
    </Container>
  </Navbar>
  <br/>
  <Switch>
<Route path='/' component={BasePage} exact/>
<Route path='/BuyItem' component={BuyItem} exact/>
<Route path='/Checkout' component={Checkout} exact/>
<Route path='/Admin' component={Admin} exact/>
  </Switch>


    </div></Router>

  );
}
}

export default App;
